import * as React from 'react';
import { Table } from 'react-bootstrap';

function HeroesList() {
    return (
        <Table striped bordered hover>
            <thead>
                <tr>
                    <th>#</th>
                    <th>Id</th>
                    <th>Name</th>
                    <th>FullName</th>
                </tr>
            </thead>
            <tbody>
            </tbody>
        </Table>
    );
}

export default HeroesList;
